import React, { useEffect, useState } from 'react';

const PlayerList = () => {
    const [formData, setFormData] = useState({

        teamWhite: {
            team: 'White',
            goalie: '',
            player1: '',
            player2: '',
            player3: '',
            player4: '',
            player5: '',
            player6: '',
        },
        teamBlack: {
            Team: 'Black',
            goalie: '',
            player1: '',
            player2: '',
            player3: '',
            player4: '',
            player5: '',
            player6: '',
        },
    });

    const handlePlayerNameChange = (team, player, newName) => {
        setFormData((prevData) => {
            const updatedData = { ...prevData };
            updatedData[team][player] = newName;
            return updatedData;
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Save the form data to local storage
        localStorage.setItem('formData', JSON.stringify(formData));
        // Clear the form data
        setFormData({
            teamWhite: {
                team: 'White',
                goalie: '',
                player1: '',
                player2: '',
                player3: '',
                player4: '',
                player5: '',
                player6: '',
            },
            teamBlack: {
                Team: 'Black',
                goalie: '',
                player1: '',
                player2: '',
                player3: '',
                player4: '',
                player5: '',
                player6: '',
            },
        });
    };

    useEffect(() => {
        const savedFormData = JSON.parse(localStorage.getItem('formData'));
        if (savedFormData) {
            setFormData(savedFormData);
        }
        console.log(savedFormData);
    }, []);

    return (
        <>
            <h1 style={{ textAlign: 'center' }}>Roll Call</h1>
            <div style={{ display: 'flex', justifyContent: 'center' }}>
                <form onSubmit={handleSubmit}>
                    <div className='team'>
                        <h3>Team White</h3>
                        <div style={{ display: 'flex', flexDirection: 'column', gap: '20px' }}>
                            <input
                                type='text'
                                value={formData.teamWhite.goalie}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamWhite', 'goalie', e.target.value)
                                }
                                placeholder='Goalie'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamWhite.player1}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamWhite', 'player1', e.target.value)
                                }
                                placeholder='Player 1'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamWhite.player2}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamWhite', 'player2', e.target.value)
                                }
                                placeholder='Player 2'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamWhite.player3}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamWhite', 'player3', e.target.value)
                                }
                                placeholder='Player 3'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamWhite.player4}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamWhite', 'player4', e.target.value)
                                }
                                placeholder='Player 4'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamWhite.player5}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamWhite', 'player5', e.target.value)
                                }
                                placeholder='Player 5'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamWhite.player6}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamWhite', 'player6', e.target.value)
                                }
                                placeholder='Player 6'
                                style={{ width: '300px' }}
                            />
                        </div>
                    </div>
                    <div className='team'>
                        <h3>Team Black</h3>

                        <div style={{ display: 'flex', flexDirection: 'column', gap: '20px' }}>
                            <input
                                type='text'
                                value={formData.teamBlack.goalie}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamBlack', 'goalie', e.target.value)
                                }
                                placeholder='Goalie'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamBlack.player1}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamBlack', 'player1', e.target.value)
                                }
                                placeholder='Player 1'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamBlack.player2}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamBlack', 'player2', e.target.value)
                                }
                                placeholder='Player 2'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamBlack.player3}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamBlack', 'player3', e.target.value)
                                }
                                placeholder='Player 3'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamBlack.player4}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamBlack', 'player4', e.target.value)
                                }
                                placeholder='Player 4'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamBlack.player5}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamBlack', 'player5', e.target.value)
                                }
                                placeholder='Player 5'
                                style={{ width: '300px' }}
                            />
                            <input
                                type='text'
                                value={formData.teamBlack.player6}
                                onChange={(e) =>
                                    handlePlayerNameChange('teamBlack', 'player6', e.target.value)
                                }
                                placeholder='Player 6'
                                style={{ width: '300px' }}
                            />
                        </div>
                    </div>
                    <button style={{ marginTop: '20px' }} type='submit'>
                        Submit
                    </button>
                </form>
            </div>
        </>
    );
};

export default PlayerList;
